import React from "react";
import data from "../data/people.json";


export default function Review() {
    return (
        <div>
        <h2>Review</h2>
        <h3>{data.reviews.name}</h3>
        <h4>{data.reviews.job}</h4>
        <p>{data.reviews.text}</p>
        </div>
    );
}
